import React from 'react'

function Home() {
  return (
    <div>
        <img src="data:image/jpeg;base64," alt="bsp"/>
        <h1>Bihar State Power (Holding) Company Limited</h1>
        <p>Hamara Aadhaar... Urjasvit Bihar</p>
        <img src="bihar_govt_logo.jfif" alt="bihar govt"></img>

    </div>
  )
}

export default Home;
